import React from 'react';

export default function Filtershop(props){

    return (
        <div class="container-fluid">
              <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
              </button>
              <div class="collapse navbar-collapse" id="navbarSupportedContent">
                  <strong class="text-dark"> Categories:</strong>
                <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                  <li class="nav-item">
                    <a class="nav-link active" aria-current="page" href="#">All</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Clothing &amp; Accessories</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Water filter</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Navigation</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">First Aid &amp; Health</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Pass</a>
                  </li>
                </ul>
                <form class="d-flex">
                  <input class="form-control me-2" type="search" placeholder="Type" aria-label="Search" />
                  <button class="btn btn-outline-dark" type="submit">Search</button>
                </form>
              </div>
            </div>
    )

    }

